import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { HeaderComponent } from './header/header.component';
import { FooterComponent } from './footer/footer.component';
import { supplierDashboardComponent } from './dashboard/dashboard.component';
import { createSupplierCardComponent } from './dashboard/create-supplier-card/create-supplier-card.component';
import { FormsModule } from '@angular/forms';
import { HttpClientModule, HTTP_INTERCEPTORS } from '@angular/common/http';
import { TaskDetailsComponent } from './dashboard/task-details/task-details.component';
import { ProductCardComponent } from './dashboard/product-card/product-card.component';
import { RouterModule, Routes } from '@angular/router';

const routes:Routes = [
  {path:'supplier', component:supplierDashboardComponent},
  {path:'products',component:ProductCardComponent}
]

@NgModule({
  declarations: [
    AppComponent,
    HeaderComponent,
    FooterComponent,
    supplierDashboardComponent,
    createSupplierCardComponent,
    TaskDetailsComponent,
    ProductCardComponent
  ],
  imports: [
    BrowserModule,
    FormsModule,
    HttpClientModule,
    FormsModule,
    RouterModule.forRoot(routes)
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
